import React from 'react';
import { Nav, Navbar, Button, Form } from 'react-bootstrap';
import Image from 'react-bootstrap/Image';

function App() {
  return (
    <div>
      <Navbar bg="dark" expand="lg">
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mr-auto">
            <Nav.Link href="#home" ><span class="text-light">Home</span></Nav.Link>
            <Nav.Link href="#link"><span class="text-light">TV Shows</span></Nav.Link>
            <Nav.Link href="#link"><span class="text-light">Movies</span></Nav.Link>
          </Nav>

          <Nav className="mr-auto">
            <Nav.Link href="#home"> <Image src="" fluid /> </Nav.Link>
          </Nav>

          <Form inline>
            <Button variant="btn btn-light mr-3 text-danger" style={{width:100}}>Register</Button>
            <Button variant="btn btn-danger" style={{width:100}}>Login</Button>
          </Form>
        </Navbar.Collapse>
      </Navbar>
    </div>
  );
}

export default App;
